import React from "react";
import { Link, Switch, Route, Router } from "react-router-dom";
import Button from "react-bootstrap/Button";
import "bootstrap/dist/css/bootstrap.min.css";
import Usuario from "./components/cadastroUsuario";
import Veiculo from "./components/cadastroVeiculo";
import Busca from "./components/buscaVeiculo";
import "./App.css";

function App() {
  return (
    <Router>
      <div className="App">
        <h1>ParkSys</h1>
        <Link to="/usuario"> Cadastrar Usuario</Link>
        <Link to="/veiculo"> Cadastrar Veiculo</Link>
        <Link to="/busca"> Buscar </Link>
        <Switch>
          <Route exact path="/usuario" component={Usuario} />
          <Route exact path="/veiculo" component={Veiculo} />
          <Route exact path="/busca" component={Busca} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
